export default class Gallery extends React.Component {
  onClick = e => {
    e.preventDefault();
  };
  render() {
    return (
      <div id="content">
        <div className="row hidden-mobile">
          <div className="col-xs-12 col-sm-6 col-md-6 col-lg-6">
